import React, { useState, useEffect } from 'react'
import axios from 'axios';
import { useNavigate, Link, useParams } from 'react-router-dom';

const FormEditUser = () => {

    const [mail, setMail] = useState('');
    const [contraseña, setContraseña] = useState('');
    const [confContraseña, setConfContraseña] = useState('');
    const [rol, setRol] = useState('');
    const [msg, setMsg] = useState('');
    const navigate = useNavigate();
    const { idUsuario } = useParams();

    useEffect(() => {
        const getUserById = async () => {
            try {
                const response = await axios.get(`http://localhost:3001/users/${idUsuario}`
                );
                setMail(response.data.mail);
                setContraseña(response.data.contraseña);
                setConfContraseña(response.data.contraseña);
                setRol(response.data.rol);

            }
         catch (error) {
            if (error.response) {
                setMsg(error.response.data.msg);
            }
        }
    };
    getUserById();
 }, [idUsuario]);

    const updateUser = async (e) => {
        e.preventDefault();
        try {
            await axios.patch(`http://localhost:3001/users/${idUsuario}`,{
                mail,
                contraseña,
                confContraseña,
                rol
            });
            navigate('/users');
        } catch (error) {
            if (error.response) {
                setMsg(error.response.data.msg);
            }
        }
    }
  return (
    <div>
    <h1 className="title" style={{color:"black"}}>Usuarios</h1>
    <h2 className="subtitle" style={{color:"black"}}> Editar usuario </h2>
    <div className="card is-shadowless has-background-light">
        <div className="card-content">
            <div className="content">
            <form action="" onSubmit={updateUser}>
                <div className="field">
                    <label  className="label" style={{color:"black"}}> Email </label>
                    <div className="control">
                        <input type="text" className="input has-background-white has-text-black custom-input"  value={mail} onChange={(e) => setMail (e.target.value)} required placeholder="Email"/>
                    </div>
                </div>
                <div className="field">
                    <label  className="label" style={{color:"black"}}> Contraseña </label>
                    <div className="control">
                        <input type="password" className="input has-background-white has-text-black custom-input" value={contraseña} onChange={(e) => setContraseña (e.target.value)} required placeholder="*****"/>
                    </div>
                </div>
                <div className="field">
                    <label  className="label" style={{color:"black"}}> Confirmar contraseña </label>
                    <div className="control">
                        <input type="password" className="input has-background-white has-text-black custom-input" style={{color:"black"}} value={conf} onChange={(e) => setRazonSocial (e.target.value)}required placeholder="*****"/>
                    </div>
                </div>
                <div className="field">
                    <label  className="label" style={{color:"black"}}> Rol </label>
                    <div className="control">
                       <div className="select is-fullwitdh ">
                        <select name="" id="">
                            <option value="1"> 1-Admin</option>
                            <option value="2"> 2-Usuario</option>
                        </select>
                        </div> 
                    </div>
                </div>
                <div className="field">
                    <div className="control">
                    <button className="button is-success" style={{ backgroundColor: "#183e6e", color: "white", marginRight: "10px" }}> Actualizar </button>
                    <button className="button is-success" style={{ backgroundColor: "#183e6e", color: "white" }}> Cancelar </button>
                    </div>         
                </div>
            </form>
            </div>
        </div>
    </div>
</div>
  )
}

export default FormEditUser
